import React from 'react'

function Header() {
    return (
        <div className = "container">
            <div className = "row">
                <div className = "text-center" href="/" style={{
                color: "#6d98ba",
                alignItems: "left"
                }}>Error and Log Management
                </div>
                <div className = "col-6">
                2 of 3 (wider)
                </div>
                <div className = "col">
                3 of 3
                </div>
            </div>
    </div>
    )
}
export default Header;
